import React from 'react';

export default function TableHeaders() {
  return (
    <tr>
      <th>Name</th>
      <th>Rotation Period</th>
      <th>Orbital Period</th>
      <th>Diameter</th>
      <th>Climate</th>
      <th>Gravity</th>
      <th>Terrain</th>
      <th>Surface Water</th>
      <th>Population</th>
      {/* <th>Films</th>
      <th>Created</th>
      <th>Edited</th>
      <th>URL</th> */}
    </tr>
  );
}
